/*import afbeeldingen*/
import iconClothing from "../../../img/tshirt.png";
import iconFreeShipping from "../../../img/free-delivery.png";
import iconQuality from "../../../img/badge.png";
import iconRetouneren from "../../../img/product-return.png";
const FeaturedcardDatas = [
    {
        Icon: iconClothing,
        Heading: "Clothing",
        Beschrijving: "Streetweare clothing",
    },
    {
        Icon: iconFreeShipping,
        Heading: "Free Shipping",
        Beschrijving: "Streetweare clothing",
    },
    {
        Icon: iconQuality,
        Heading: "Quality Clothes",
        Beschrijving: "Streetweare clothing",
    },
    {
        Icon: iconRetouneren,
        Heading: "Returning",
        Beschrijving: "Streetweare clothing",
    },

]

export default {FeaturedcardDatas};
